import React from "react";

import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

const Admin = () => {
	return (
		<div>
			<Router>
				<Routes>
					<Route path="/" element="Hello" />
					<Route path="/admin" element="Bruh" />
				</Routes>
			</Router>
		</div>
	);
};

export default Admin;
